import React from 'react'

const ApplicantDetails = () => {

  const getDetails = () => {
    fetch("/applicant/details/")
    .then((res) => res.json())
    .then((data) => {
      console.log(data)
    })
  }

  return (
    <div>ApplicantDetails</div>
  )
}

export default ApplicantDetails
